import React from "react";
import {useDispatch, useSelector} from "react-redux";
import {documentDetail, selectDocuments, selectorStatus} from "./documentsSlice";
import {spinnerDeRecherche} from "./spinnerDeRecherche";


export const ResultatRecherche = () => {
    const documents = useSelector(selectDocuments)
    const dispatch = useDispatch()
    const state = useSelector(selectorStatus)
    const detail = (document) =>{
        dispatch(
            documentDetail(
                {
                    selected: document
                }
            )
        )
    }

    const renderedDocuments = documents.map(document => (
        <li className={"list-group-item"} key={document.id} onClick={()=> detail(document)}>
            <p>{document.shape}</p>
        </li>
    ))

    const listRender = (<ul className={"list-group documents-list"}>
        {renderedDocuments}
    </ul>)
    return(
        state === "loading" ?<spinnerDeRecherche /> : listRender
        /*<ul className={"list-group documents-list"}>
            {renderedDocuments}
        </ul>*/
    )
}
